export function createUpdate(eventTime: number, lane: Lane): Update<*> {
  const update: Update<*> = {
    eventTime,
    lane,

    tag: UpdateState,
    payload: null, // 待更新的元素
    callback: null,

    next: null,
  };
  return update;
}
