  // 计数器切片
  const counterSlice = createSlice({
    name: "counter",
    initialState: {
      value: 0,
    },
    reducers: {
      incremented: (state) => {
        state.value += 1;
      },
      decremented: (state) => {
        state.value -= 1; 
      },
    },
  });

