  const Actions = {
    INCREMENT: "INCREMENT",
    DECREMENT: "DECREMENT",
    RESET: "RESET",
  };

  // 3. 定义动作创建器
  const increment = () => ({ a: Actions.INCREMENT });
  const decrement = () => ({ a: Actions.DECREMENT });
  const reset = () => ({ a: Actions.RESET });

